var title_f11_28_11717="Invasive hemodynamic tracing provoked LVOT gradient in HCM";
var content_f11_28_11717=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F65235&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F65235&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 491px\">",
"   <div class=\"ttl\">",
"    Invasive hemodynamic tracing in a patient with HCM showing inducible LVOT obstruction following a VPB and the Valsalva maneuver",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 471px; height: 184px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are five surface ECG leads (I, II, aVL, V1, V6) and the left ventricular (LV, arrows) and aortic (Ao, arrows) pressure tracings from a patient with hypertrophic cardiomyopathy. In the basal state, the LV and Ao pressures are equal at over 200 mmHg and there is no LV outflow gradient. However, after ventricular premature beats (VPB, arrows), there is an LV outflow tract pressure gradient of about 140 mmHg; in addition, the LV outflow tract pressure gradient is 70 mmHg during a Valsalva maneuver. LV outflow obstruction is associated with narrowing of the arterial pulse pressure.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Lameh Fananapazir, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
