var title_f11_28_11723="Osteopenia and osteoporosis";
var content_f11_28_11723=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F74190&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F74190&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic categories for osteopenia and osteoporosis based upon bone mineral density measurement by DXA",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Category",
"      </td>",
"      <td class=\"subtitle1\">",
"       Bone mass",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Normal",
"      </td>",
"      <td>",
"       A value for bone mineral density (BMD) within one standard deviation of the young adult female reference mean (T-score greater than or equal to -1 SD).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Low bone mass (osteopenia)",
"      </td>",
"      <td>",
"       A value for BMD more than one but less than 2.5 standard deviations below the young adult female reference mean (T-score less than -1 and greater than -2.5 SD).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Osteoporosis",
"      </td>",
"      <td>",
"       A value for BMD 2.5 or more standard deviations below the young adult female reference mean (T-score less than or equal to -2.5).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Severe (established) osteoporosis",
"      </td>",
"      <td>",
"       A value for BMD more than 2.5 standard deviations below the young adult female reference mean in the presence of one or more fragility fractures.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: World Health Organization.&nbsp;WHO scientific group on the assessment of osteoporosis at the primary health care level. Summary meeting report 2007, Geneva.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
