"     GI: gastrointestinal; IV: intravenous.",
"     <br>",
"      * Supportive care of airway, breathing, circulation, and where appropriate, anticipation of liver or renal failure, seizures, hemolytic anemia, methemoglobinemia, and/or rhabdomyolysis are the mainstays of treatment for mushroom poisoning. Aggressive intravenous fluid resuscitation is often necessary for patients with severe vomiting and diarrhea. See \"Management of mushroom poisoning\".",
